        var buttonBConfig = config.buttonB || defaultButtonConfig;
        var buttonMode = config.buttonMode;
        if (buttonMode === undefined) {
            buttonMode = (!!buttonAConfig && !!buttonBConfig) ? 2 :
                (!!buttonAConfig) ? 1 :
                    0;
        }

        var defaultButtonCreator = creators.button;
